import React from 'react';
import './PreferenceButton.css'; // Import CSS file for styling

const PreferenceButton = ({ preference, onClick }) => {
  if (preference.selected) {
    return null; // Render nothing if the preference is selected
  }

  return (
    <button className="preferenceButton" onClick={() => onClick(preference.id)}>
      {preference.name}
    </button>
  );
};

export default PreferenceButton;
